import React, { Component } from "react";

import { connect } from "react-redux";
import "./HomeHeader.scss";

class HomeHeader extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="home-header-container">
          <div className="home-header-content">
            <div className="left-content">
              <i class="fas fa-bars"></i>
              <div className="header-logo"></div>
            </div>
            <div className="center-content">
              <div className="child-content">
                <div>
                  <b>Loại lẩu</b>
                </div>
                <div className="subtitle">Tìm lẩu theo loại</div>
              </div>
              <div className="child-content">
                <div>
                  <b>Nhà hàng</b>
                </div>
                <div className="subtitle">Chọn nhà hàng gần bạn</div>
              </div>
              <div className="child-content">
                <div>
                  <b>Món lẩu</b>
                </div>
                <div className="subtitle">Chọn món lẩu yêu thích</div>
              </div>
              <div className="child-content">
                <div>
                  <b>Thông tin khác</b>
                </div>
                <div className="subtitle">Khám phá</div>
              </div>
            </div>
            <div className="right-content">
              <div className="support">
                <i class="fas fa-question-circle"></i>Hỗ trợ
              </div>
              <div className="flag">VN</div>
            </div>
          </div>
        </div>
        <div className="home-header-banner">
          <div className="title1">TINH HOA LẨU</div>
          <div className="title2">HỘI TỤ LẨU TRÊN THẾ GIỚI</div>
          <div className="search">
            <i className="fas fa-search"></i>
            <input type="text" />
          </div>
          <div className="options"></div>
        </div>
      </React.Fragment>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    isLoggedIn: state.user.isLoggedIn,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {};
};

export default connect(mapStateToProps, mapDispatchToProps)(HomeHeader);
